import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
const Project = () => {
  return (
    <div id="projects">
      <div className="text-center hd">
        <h4 className="">Projects I have Done</h4>
        <div class="d-flex col-sm-10 col-12">
          <div class="row"></div>
         
        </div>
      </div>
    </div>
  );
};
export default Project;
